import React, { useEffect, useState } from 'react'
import { useSelector, useDispatch } from 'react-redux'
import axios from 'axios'
import YouTube from 'react-youtube'
import CarteDoctor from './CarteDoctor'
import Information from './Information'
import Service from './Service'
import Articles from './Articles'
import QuestionRepense from './QuestionRespense'
import videosList from './Videos'

const Blog = () => {
  const dispatch = useDispatch()
  var counter = ''
  var error = ''

  useEffect(() => {
    axios
      .get('https://ws.med.tn/web/doctorInfos/?api_key=drmateri')
      .then(response => {
        console.log('state.response', response)
        dispatch({
          type: 'SET_POSTS',
          payload: Object.values(response)[0],
        })
      })
      .catch(error => {
        console.log('state.response', error)
        dispatch({ type: 'SET_ERROR', payload: error })
      })
  }, [])

  const opts = {
    playerVars: {
      // https: developers.google.com / youtube / player_parameters,
      autoplay: 1,
    },
  }
  useSelector(state =>
    state && state.posts != undefined
      ? (counter = state.posts)
      : state && (error = state.error)
  )

  return counter ? (
    <div className="containerGlobal">
      <div className="container">
        {/* // carte1 */}
        <CarteDoctor />
        {/* // carte2  */}
        <Information />
        {/* // carte3  */}
        <Service />
        {/* // carte4  */}
        <Articles></Articles>
        {/*carte6*/}
        <QuestionRepense />

        {/* carte5 */}
        <videosList />

        <div className="footer">
          <a>Copyright Â©2020 Med.tn</a>
        </div>
      </div>
    </div>
  ) : (
    error != undefined && <p>Something went wrong </p>
  )
}

export default Blog
